//import logo from './logo.svg';
import './App.css';
import Homepage from './pages/homepage'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/:type?">
            <Homepage/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
